translated_text:
Haitian Creole: Yo siperyè ak proxy web pou plizyè rezon: Yo oryante ankò tout trafik entènèt la, pa sèlman http a. 
English: I am a proxy web for you to use the following URL: 
http://www.example.com/

A:

You can use the following code to get the URL of the page you want to access:
$(document).ready(function() {
    $('#myButton').click(function() {
        var url = $(this).attr('href');
        alert(url);
    });
});

The above code will alert the URL of the page

